import React from "react";
import UsersRow from "./UsersRow";

const [currUsers, setCurrUsers] = useState([]);

const getCurrUsers = () => {
    fetch('/get_users')
        .then(res => res.json())
        .then(json => setCurrUsers(json.users));
}

useEffect(() => getCurrUsers(), []);

class Table extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <table>
                <thead>
                <UsersRow usernames={this.state.usernames}/>
                </thead>
                <tbody>

                </tbody>
            </table>
        );
    }
}

export default Table;
